import React from 'react';
import InvoiceTable from '../../TableDisplay/TableDiasplay';

export default function ContainerEntry() {
    return(
      <InvoiceTable 
        key={JSON.stringify(columns) + JSON.stringify(rows)}
        columns={columns} 
        rows={rows} 
        addDataComponent={VehicleCU}
      />
    );

}
